import React from 'react';
import ReactDOM from 'react-dom';
import './MyApp.css';
import logo from './dccs.png';

class MyApp extends React.Component {
  render(){
    return(
      <div id="mainDiv">
        <div id="searchBar">
          <div class="imageDiv">
            <img id="logoImg" src={logo}/>
          </div>
          <input id="searchInput" type="text" />
        </div>
        <p>My App</p>
      </div>
    );
  }
}

export default MyApp;
